(function($){
    var initializeBlock = function( $block ) {
        $block.find('.slick-slider').slick({
            infinite: true,
            arrows: true,
            speed: 300,
            slidesToShow: 6,
            slidesToScroll: 1,
            prevArrow: $('.arrow-prev'),
            nextArrow: $('.arrow-next'),
            responsive: [
                {
                    breakpoint: 991,
                    settings: {
                        slidesToShow: 5,
                    }
                },
                {
                    breakpoint: 767,
                    settings: {
                        slidesToShow: 4,
                    }
                },
                {
                    breakpoint: 575,
                    settings: {
                        slidesToShow: 3,
                    }
                }
            ]
        });
    }


    $(document).ready(function(){
        $('.section-slider-block').each(function(){
            initializeBlock( $(this) );
        });
    });

})(jQuery);
